import Button from "../../../../components/Button";

const MeetKody = () => {
  return (
    <div id="kody" className="pt-24">
      <h1 className="text-6xl max-sm:text-4xl font-medium mb-10">
        Meet Kody...Your Competition Companion!
      </h1>
      <p className="text-3xl text-green-600 mb-2">
        Meet Kody: The Heart of Your Coding Journey
      </p>
      <p className="max-w-[33em] text-gray-200">
        Kody is your friendly guide through every coding challengeâ€”ensuring
        fairness, offering helpful tips, and cheering you on all the way!
      </p>
      <Button className="max-w-[45em]">
      <p className="text-2xl text-center max-sm:text-lg z-20">
          Your coding journey starts here! Sign up and join the next competition
          now.
        </p>
      </Button>
    </div>
  );
};

export default MeetKody;
